// src/components/ChartCard.js
import React from 'react';

const ChartCard = ({ title, children }) => (
  <div style={{
    border: '1px solid #ddd',
    padding: '1rem',
    borderRadius: '8px',
    marginBottom: '1rem',
    backgroundColor: '#fff',
    boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
  }}>
    <h2>{title}</h2>
    {children}
  </div>
);

export default ChartCard;
